var tnt_theme = tnt_theme_track_performance_test = function () {

    var ta = tnt.tree_annot();
    var h = 20;

    // Tree side
    var tree = tnt.tree()
	.data (tnt.tree.parse_newick (newick))
	.node_circle_size(2)
        .layout (tnt.tree.layout.vertical()
                 .width(400)
                 .scale(false)
                )
        .label (tnt.tree.label.text()
		.text(function (n) {
		    if (n.is_leaf()){
			return n.node_name()
		    }
		    return ""
		})
                .height(h))
        .on_click (function (node) {
            node.toggle()
            ta.update();
        });

    // Annotation side
    var annot = tnt.board()
	.axis(true)
	.render (tnt.track.render.websocket())
	.width(800)
	.from(0)
	.async_limits(function (done) {
	    d3.json("/limit", function (err, resp) {
		if (err) {
		    throw (err);
		}
		annot.zoom_out(resp.limit);
		annot.to(resp.limit);
		annot.right(resp.limit);
		done();
	    });
	});
    
    // Track creation side
    var track = function (leaf_node) {
	var name = leaf_node.node_name();
	return tnt.track()
	    .foreground_color("steelblue")
	    .display(tnt.track.feature.empty());
	    // .data (tnt.track.data()
	    // 	   .update (tnt.track.retriever.sync()
	    // 		    .retriever (function () {
	    // 			return blocks;
	    // 		    })
	    // 		   )
	    // 	  )
	    // .display (tnt.track.feature.block()
	    // 	      .index (function (d) {
	    // 		  return d.start;
	    // 	      })
	    // 	     );
    };

    ta
	.tree(tree)
	.annotation(annot)
	.track(track);

    var theme = function (div) {
	ta(div);
    }

    return theme;
};

